VQySEVRVjhuWno","elapsedMediaTimeSeconds":5},"videostatsScheduledFlushWalltimeSeconds":[10,20,30],"videostatsDefaultFlushIntervalSeconds":40},"videoDetails":{"videoId":"DUXAETM7oek","title":"SPIRA-BM: Biomarcadores p/Condies Respiratrias em Dispositivos Mveis por Anlise de udio com IA","lengthSeconds":"0","isLive":true,"channelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isOwnerViewing":false,"shortDescription":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","isCrawlable":true,"isLiveDvrEnabled":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CPSRqsgG-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDnKSPk-dL4w4FhOevgJWQpUHS_IA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CPSRqsgG-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCsUB-uW9583vWvIhYW01NLQLJWVg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CPSRqsgG-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCWg9O_Tmg5DUfA2XFc4qT8LbFXHw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CPSRqsgG-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDFHyx_7J9DUeGo0Mvd-wj7bJ70jw","width":336,"height":188}]},"liveChunkReadahead":3,"allowRatings":true,"viewCount":"46","author":"Forum da Ps-Graduao em Computao do Paran","isLowLatencyLiveStream":true,"isPrivate":false,"isUnpluggedCorpus":false,"latencyClass":"MDE_STREAM_OPTIMIZATIONS_RENDERER_LATENCY_LOW","isLiveContent":true},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"9223372036854775807","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/DbzZ9YQgF77C1RI_pNx0jQ/featured_channel.jpg?v=620ba84f","width":40,"height":40}]},"trackingParams":"CAkQ8zciEwjdp4iD0NmQAxV_TEgAHXeyBlk=","navigationEndpoint":{"clickTrackin ivos Mveis por Anlise de udio com IA"},"description":{"simpleText":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: ,"showLessText":{"simpleText":"Mostrar menos"},"trackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMm","defaultExpanded":true,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMmygEE6cf3Ww==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMmygEE6cf3Ww==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMmygEE6cf3Ww==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMmygEE6cf3Ww==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMIhrWIg9DZkAMVb2lIAB29SRMmSOnD7pmTgvCiDcoBBOnH91s=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblJlMEg0aVRQS1h3aEVuWEktZGdLNVJFLXdWQXxBQ3Jtc0trYXkxb2FqcldfdmtUTUVxcGUySmtpQnpDUUVINW9YRWxTZi1veGcwRlI0dmxVTFZVcVM5RjZXQ29IYklsSmsySnd3U1p2WHhwMGlFSVotOC1MX1h3WkV5aDMzdHcwRXVYSGNXTkFvLU9fRFNrWXByUQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblJlMEg0aVRQS1h3aEVuWEktZGdLNVJFLXdWQXxBQ3Jtc0trYXkxb2FqcldfdmtUTUVxcGUySmtpQnpDUUVINW9YRWxTZi1veGcwRlI0dmxVTFZVcVM5RjZXQ29IYklsSmsySnd3U1p2WHhwMGlFSVotOC1MX1h3WkV5aDMzdHcwRXVYSGNXTkFvLU9fRFNrWXByUQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026 rppgcpr"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/KpMrcI0yPguHgFjIN11Eb8ZJAhLD9dZonDV8nIgiFHqklHny1KB6wjgHXpup_AbexbEpM0_3sw=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwiGtYiD0NmQAxVvaUgAHb1JEyZI6cPumZOC8KINygEE6cf3Ww==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazVsWTlXTjJpdzh5eWo5TmhoWUVDMHdKUm1XQXxBQ3Jtc0tuTmFJRTc0bDRxb3oxZjMtVFl0aEZpbGh6Z2JoeDVNRjdwaFdKT2tldVAzR0tqVFBpd25Pc1NGSm1yWmJiMUtGcXcwcjNXSDFlUHdMTC1pQ0x3NFlrcEI5c2hPTmwtMTgyb0xkUHJsN0ljbmVWM0pNZw\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazVsWTlXTjJpdzh5eWo5TmhoWUVDMHdKUm1XQXxBQ3Jtc0tuTmFJRTc0bDRxb3oxZjMtVFl0aEZpbGh6Z2JoeDVNRjdwaFdKT2tldVAzR0tqVFBpd25Pc1NGSm1yWmJiMUtGcXcwcjNXSDFlUHdMTC1pQ0x3NFlrcEI5c2hPTmwtMTgyb0xkUHJsN0ljbmVWM0pNZw\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwiGtYiD0NmQAxVvaUgAHb1JEyZI6cPumZOC8KINygEE6cf3Ww==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazJTbXVwOUYyalhqbXJNM180SWw2Y2RMM2JaUXxBQ3Jtc0tuQk9KM19IVm9tOW93cFJoYk9oR2RPME5wWEM5blM2b290UEZDV0h1SXRzNHhjSUpueTFaU1FNWURrbmFoSXBLd2otdFVoWE5pRWowR2YwOEw4N25sVWlYWXZidVpQdUNrTGJ5Ymhmc1JYTHk1SFNzTQ\u0026q=h
